  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tule Lake National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1943. The report begins by summarizing the weather conditions, water conditions,
  food and cover, and fires during this period. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, raptors, and
  fish- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. The public relations section of the report
  describes Refuge visitors, Refuge participation, hunting, and violations. N-R forms,
  photographs, and narrative reports on Clear Lake National Wildlife Refuge, Upper
  Klamath National Wildlife Refuge, and Lower Klamath National Wildlife Refuge are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
